import React from "react";
import "./Adminorderlist.css";
import { AiOutlineArrowRight } from "react-icons/ai";

export default function Adminorderlist() {
  return (
    <>
      <div className="adminorderlist">
        <Singleadminorderlist
          id={"o1001"}
          price={"$1200"}
          cost={"$234"}
          product={"Apple iPad"}
          cname={"Sylvia Sullivan"}
          sdate={"15 Jan 2026"}
          edate={"15 Jan 2019"}
          cstatus={"Expectation"}
        />
        <Singleadminorderlist
          id={"o1002"}
          price={"$567"}
          cost={"$120"}
          product={"5Products"}
          cname={"Alvin Kim"}
          sdate={"15 Jan 2026"}
          edate={"15 Jan 2019"}
          cstatus={"Assebly"}
        />
        <Singleadminorderlist
          id={"o1003"}
          price={"$778"}
          cost={"$70"}
          product={"3 Products"}
          cname={"Linnie Griffith"}
          sdate={"17 Jan 2026"}
          edate={"15 Jan 2019"}
          cstatus={"Delivery"}
        />
        <Singleadminorderlist
          id={"o1004"}
          price={"$1456"}
          cost={"$250"}
          product={"Sumsung"}
          cname={"Troy Guerrero"}
          sdate={"16 Jan 2026"}
          edate={"15 Jan 2019"}
          cstatus={"Done"}
        />
        <Singleadminorderlist
          id={"o1005"}
          price={"$2478"}
          cost={"$320"}
          product={"Apple ipod"}
          cname={"Eliza klein"}
          sdate={"15 Jan 2026"}
          edate={"15 Jan 2019"}
          cstatus={"Failed"}
        />
<Singleadminorderlist
          id={"o1006"}
          price={"$1234"}
          cost={"$120"}
          product={"4Products"}
          cname={"David Shalton"}
          sdate={"11 Jan 2026"}
          edate={"15 Jan 2019"}
          cstatus={"Exception"}
        />
        <Singleadminorderlist
          id={"o1001"}
          price={"$"}
          cost={"$"}
          product={""}
          cname={""}
          sdate={"15 Jan 2026"}
          edate={"15 Jan 2019"}
          cstatus={""}
        />
        <Singleadminorderlist
          id={"o1001"}
          price={"$"}
          cost={"$"}
          product={""}
          cname={""}
          sdate={"15 Jan 2026"}
          edate={"15 Jan 2019"}
          cstatus={""}
        />
        <Singleadminorderlist
          id={"o1001"}
          price={"$"}
          cost={"$"}
          product={""}
          cname={""}
          sdate={"15 Jan 2026"}
          edate={"15 Jan 2019"}
          cstatus={""}
        /><Singleadminorderlist
        id={"o1001"}
        price={"$"}
        cost={"$"}
        product={""}
        cname={""}
        sdate={"15 Jan 2026"}
        edate={"15 Jan 2019"}
        cstatus={""}
      />
      <Singleadminorderlist
          id={"o1001"}
          price={"$"}
          cost={"$"}
          product={""}
          cname={""}
          sdate={"15 Jan 2026"}
          edate={"15 Jan 2019"}
          cstatus={""}
        />
        <div className="adminorderlist_end">
          <button>Load More Products</button>
        </div>
      </div>
    </>
  );
}

function Singleadminorderlist({
  id,
  price,
  cost,
  product,
  cname,
  sdate,
  edate,
  cstatus,
}) {
  return (
    <>
      <div className="singleadminorderlist">
        <div className="singleadminorderlist_row">
          <div className="singleadminorderlist_row_button">
            <input type="radio"></input>
          </div>
          <label className="singleadminorderlist_row_id">{id}</label>
          <label className="singleadminorderlist_row_price">{price}</label>
          <label className="singleadminorderlist_row_cost">{cost}</label>
          <label className="singleadminorderlist_row_product">{product}</label>
          <label className="singleadminorderlist_row_cname">{cname}</label>
          <span className="singleadminorderlist_row_sdate">{sdate}</span>
          <span className="singleadminorderlist_row_edate">{edate}</span>
          <div className="singleadminorderlist_row_input">
            <input />
            <span className="singleadminorderlist_row_input_status">
              {cstatus}
            </span>
          </div>
          <AiOutlineArrowRight
            className="singleadminorderlist_row_arrow"
            style={{ color: "#C3CAD9", fontSize: "20px" }}
          />
        </div>
      </div>
    </>
  );
}
